import React from 'react';
import { Stands } from './Stands';
export const Stations = ({station}) =>{


let ItemList = []

if(station){
   ItemList = station.map(sta => {
    return (

      <div key={sta.id} className='station-card' >
      <button className='accordion'> {sta.name} </button>
      <h3>{sta.name}</h3>

        <Stands station={sta}/>

      </div>
    )
  })
}
  return(
<div className='station-wraper'>
  {ItemList}
</div>
  )
}
